import logo from './logo.svg';
import { createMuiTheme, ThemeProvider, makeStyles } from '@material-ui/core/styles';
import CustomBtn from './components/CustomB&n'
import './App.css';

const theme = createMuiTheme({
  palette: {
    primary: {
      main:"#2e1667",
    },
    secondary: {
      main:"#c7d8ed",
    },
  },
  typography: {
    fontFamily: [
      'Roboto'
    ],
    h4: {
      fontWeight: 600,
      fontSize: 28,
      lineHeight: '2rem',
      },
    h5: {
      fontWeight: 100,
      lineHeight: '2rem',
    },
  },
});


function App() {
  return (
    <div className="App">
      <ThemeProvider theme={theme}>
      <CustomBtn txt="Chesney is awesome"/>
      </ThemeProvider>

    </div>

  );
}

export default App;
